import React, {Component} from "react";
import { useParams } from "react-router-dom";

//todo fix this
//singular film rendering
const Film = () => {
    
    const [film, setFilm] = [];
    let { id } = useParams();
    
    useEffect(() => {
        fetch("http://localhost:8080/api/film/" + id)
        .then(response => response.json())
        .then(data => setFilm(data))
    });
    
    return (
        <Row>{state.id}</Row>
    )
}

export default Film;
